import React from "react";

const Footer = (props) => {
  return (
    <footer style={styles.footer}>
      <h1 style={styles.h1}>{props.footerText}</h1>
    </footer>
  );
};

export default Footer;

const styles = {
  footer: {
    backgroundColor: "#ffffff",
    display: "flex",
    flexDirection: "row",
    fontSize: "0.65rem",
    justifyContent: "center",
  },
};
